import React, { Component } from "react";
import logo from './logo.svg';
import './App.css';

class App extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            monsters: [
                {
                    name: "Timmy",
                    id: "1"
                },
                {
                    name: "Timmy",
                    id: "2"
                },
                {
                    name: "Timmy",
                    id: "3"
                }
            ]
        }
    }

    render() {
        return (
            <div className="App">
                {
                    this.state.monsters.map(monster =>
                        (
                            <h1 key={monster.id}> {monster.name}</h1>
                        ))
                }
            </div>
        );
    }
}

export default App;
